import React, { Component } from 'react';
import LeftSideBar from '../LeftSideBar';
import {
  DashboardWrap,
} from './Dashboard.style';

class Dashboard extends Component {
  render() {
    return (
      <DashboardWrap>
        <LeftSideBar />
      </DashboardWrap>
    );
  }
}

export default Dashboard;
